{
  "source_code": "using System;
using System.Collections.Generic;
using System.IO;
using System.Text.Json;

public class QuoteOfTheDayModule : IGeneratedModule
{
    public string Name { get; set; } = "Quote of the Day";

    private readonly List<string> _defaultQuotes = new List<string>
    {
        "The only way to do great work is to love what you do. - Steve Jobs",
        "Life is what happens when you're busy making other plans. - John Lennon",
        "In the middle of difficulty lies opportunity. - Albert Einstein",
        "The journey of a thousand miles begins with one step. - Lao Tzu",
        "Do not watch the clock. Do what it does. Keep going. - Sam Levenson",
        "The only limit to our realization of tomorrow is our doubts of today. - Franklin D. Roosevelt",
        "Believe you can and you're halfway there. - Theodore Roosevelt"
    };

    public bool Main(string dataFolder)
    {
        try
        {
            Console.WriteLine("Quote of the Day Module is running...");

            List<string> quotes = LoadQuotes(dataFolder);
            if (quotes.Count == 0)
            {
                quotes = _defaultQuotes;
                Console.WriteLine("Using default quotes as no custom quotes were found.");
            }

            Random random = new Random();
            int index = random.Next(quotes.Count);
            string todaysQuote = quotes[index];

            Console.WriteLine("Today's Quote:");
            Console.WriteLine(todaysQuote);

            return true;
        }
        catch (Exception ex)
        {
            Console.WriteLine("An error occurred while generating the quote of the day: " + ex.Message);
            return false;
        }
    }

    private List<string> LoadQuotes(string dataFolder)
    {
        string quotesFilePath = Path.Combine(dataFolder, "quotes.json");

        if (File.Exists(quotesFilePath))
        {
            try
            {
                string jsonContent = File.ReadAllText(quotesFilePath);
                return JsonSerializer.Deserialize<List<string>>(jsonContent) ?? new List<string>();
            }
            catch
            {
                return new List<string>();
            }
        }

        return new List<string>();
    }
}",
  "name": "Quote of the Day",
  "description": "Generates a random quote of the day from a predefined list or from custom quotes stored in a JSON file",
  "required_apis": [],
  "required_nugets": []
}
